// src/product.js

const products = [
  {
    name: "Smartphone Ultra",
    price: "799€",
    description: "Un smartphone haut de gamme avec écran AMOLED.",
    image: `${process.env.PUBLIC_URL}/images/smartphone1.jpg`,
  },
  {
    name: "Smartphone Compact",
    price: "499€",
    description: "Petit mais puissant, facile à utiliser d'une seule main.",
    image: `${process.env.PUBLIC_URL}/images/smartphone2.jpg`,
  },
  {
    name: "Smartphone Pro Max",
    price: "999€",
    description: "Le summum de la technologie mobile.",
    image: `${process.env.PUBLIC_URL}/images/smartphone3.jpg`,
  },
];

